VALUES ('3257981942592', 'Crevettes & sauce cocktail', 'Crevettes décortiquées cuites (Penaeus vannamei élevées en Equateur) 110 g - sel - conservateur : E202 - antioxydant : E223 (contient sulfites) - acidifiant : E330. Sauce cocktail 30 g : eau - Ketchup (purée de tomate - sirop de glucose-fructose - vinaigre - sucre - sel - amidon transformé de pomme de terre - arôme naturel) - huile de colza - jaune d\'œuf - moutarde de Dijon (eau - graines de moutarde - vinaigre - sel - acidifiant : E330 - antioxydant : E224 [contient sulfites]) - amidon transformé de pomme de terre - vinaigre - sel - sucre - épaississants : E412, E415. Traces éventuelles de mollusques, poissons et lait . GEKOELDE GEKOOKTE GEPELDE GARNAALSTAARTEN EN COCKTAILSAUS - INGREDIÈNTEN: Gekookte gepelde garnalen (Penaeus vannamei, gekweekt in Ecuador) 110 g - zout - conserveermidde/: E202 - antioxidant: E223 (bevat sulfieten) - voedingszuur: E330. Cocktailsaus 30 g: water - ketchup (tomatenpuree - glucose-fructosestroop - azijn - suiker - zout - getransformeerd aardappe/zetmeel - natuur/ijk aroma) - koo/zaado/ie - eigee/ - mosterd van Dijon (water - mosterdzaad - azijn - zout - voedingszuur: E330 - antioxidant: E224 [bevat sulfieten]) - getransformeerd aardappelzetmeel - azijn - zout - suiker - verdikkingsmidde/en: E412, E415. Kan sporen bevatten van weekdieren, vis en melk', 'https://static.openfoodfacts.org/images/products/325/798/194/2592/front_fr.4.400.jpg', '5.1', '0.5', '2.1', '1.1', '0.5', '16.1', '1.54', '0.606299212598425', '', '0');

